import { MenuItem } from './types';

const LeftMenu: Array<MenuItem> = [
  {
    id: 'about',
    antIcon: 'user',
    label: 'about',
    link: '/about',
  },
  {
    id: 'movies',
    antIcon: 'folder-open',
    label: 'movies',
    link: '/movies',
  },
  {
    id: 'menu1',
    antIcon: 'hourglass',
    label: 'menu 1',
    children: [
      {
        id: 'submenu1-1',
        antIcon: 'fall',
        label: 'submenu 1.1',
      },
      {
        id: 'submenu1-2',
        antIcon: 'rise',
        label: 'submenu 1.2',
      },
    ]
  },
  {
    id: 'menu2',
    antIcon: 'heatmap',
    label: 'menu 2',
    children: [
      {
        id: 'submenu2-1',
        antIcon: 'area-chart',
        label: 'submenu 2.1',
      },
      {
        id: 'submenu2-2',
        antIcon: 'pie-chart',
        label: 'submenu 2.2',
      },
      {
        id: 'submenu2-3',
        antIcon: 'dot-chart',
        label: 'submenu 2.3',
      },
    ]
  },
]

export default LeftMenu;
